#!/usr/bin/env python
# encoding: utf-8


class Solution(object):
    def findRepeatedDnaSequences(self, s):
        """
        :type s: str
        :rtype: List[str]
        """
        pos = 0
        already_set = set()
        res = set()
        while pos + 10 <= len(s):
            cur_str = s[pos:pos+10]
            if cur_str in already_set:
                res.add(cur_str)
            else:
                already_set.add(cur_str)
            pos += 1
        return list(res)


if __name__ == '__main__':
    sol = Solution()
#    s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
    # s = "AAAAAAAAAAA"
    s = ""
    r = sol.findRepeatedDnaSequences(s)
    print(r)
